        flex-direction: column;
        justify-content: space-evenly;

        :hover{

            span{
               
                ::before{
                    background:black;

                }
                
                :nth-child(2n-1)::before{
                    width:50%;
                }
            }
            
        }

        span{
            display:block;
            width:100%;
            position:relative;
            ::before{
                content: "";
                position:absolute;
                width:100%;
                height:1px;
                background:#888;
                top:0;
                left:0;
                transition:all .5s;
            }

            
        }
    }
`

